import Error_404 from "../Assets/404.png"
import styled from "styled-components"

const StyleError = styled.div`
    display: flex;
    width: 1820px;
`

function Error(){
    return (
        <div className="Text_Error">
            <img src={Error_404} alt="Error" className="index_Error"/>
            <span>Oups! La page que vous demandez n'existe pas.</span>

        </div>

    )
}

export default Error
